class CategoriesModel{  bool status;  String message;  CategoryData data;  CategoriesModel.fromJson(Map<String,dynamic>json){    this.status=json['status'];    this.message=json['message'];    this.data=CategoryData.fromJson(json['data']);  }}class CategoryData{  int current_page;  List<Data> data=[];  CategoryData.fromJson(Map<String,dynamic>json){    this.current_page=json['current_page'];    json['data'].forEach((element){      data.add(Data.fromJson(element));    });  }}class Data{  int id;  String name;  String image;  Data.fromJson(Map<String,dynamic>json){    this.id=json['id'];    this.name=json['name'];    this.image=json['image'];  }}